import React from "react";

import { Link } from "react-router-dom";

const Admin = ({ match }) => {
	return (
		<div>
			<Link to={"${match.url}/"} com/>
			<Link to={"${match.url}/test"}/>
		</div>
	);
};

export default Admin;
